The 2019 #PolTAwards voting is open. We have over 500 accounts representing @WestYorksPolice on Twitter   

To vote for your favourite account go to  and vote in one of 18 categories. 

 @policeawards

We're trying to turn the lock-up at Steelhouse Lane, #Birmingham into the new WMP Museum.

@HeritageFundWM are helping make our museum dreams a reality but we need your help to buy a new roof!

Your donations - no matter how big or small - can help us #RaiseTheRoof

